import { Button ,Text,View } from "react-native";


export const HomePage = ({navigation})=> 
{
return(
<View>
    <Text>
        Hello from Home Page 
    </Text>
    <Button title="Go To Page 1"
    onPress={()=>{navigation.nav("Page1")}}
    />
     
</View>  
)
}
;
